('b7e8e7e2-7c6a-4e2e-9c2a-1a2b3c4d5e6f',  'The Amazing Devil',  'United Kingdom',  'London',  'NON-AUS', 2009,  'An indie folk band from London, The Amazing Devil is known for their emotionally charged lyrics, theatrical arrangements, and a unique blend of folk, rock, and storytelling. Their music often explores themes of love, loss, and the human condition, drawing listeners into immersive soundscapes that are both haunting and uplifting. The band, fronted by Joey Batey and Madeleine Hyland, has cultivated a devoted fanbase through their powerful live performances and poetic songwriting, making them a standout act in the contemporary folk scene.', 'https://open.spotify.com/embed/artist/3cWRLr14V7jBctYNGaSM0S?utm_source=generator',  'https://www.youtube.com/embed/p3wFZfpMQmM?si=t_JeHNug2-EgfuxJ'),
('c1f2e3d4-5b6a-7c8d-9e0f-1a2b3c4d5e6f',  'The Roots',  'USA',  'Philadelphia',  'NON-AUS', 1987,  'The Roots are a legendary hip hop band from Philadelphia, renowned for their innovative fusion of live instrumentation and rap. Formed in 1987 by Ahmir "Questlove" Thompson and Tariq "Black Thought" Trotter, the group has consistently pushed the boundaries of hip hop, incorporating elements of jazz, soul, and funk into their sound. Over the decades, The Roots have released critically acclaimed albums, served as the house band for The Tonight Show Starring Jimmy Fallon, and influenced countless artists with their socially conscious lyrics and virtuosic musicianship.', 'https://open.spotify.com/embed/artist/78xUyw6FkVZrRAtziFdtdu?utm_source=generator',  'https://www.youtube.com/embed/_qzacv8dtb4?si=nUVtG1udo2gZ8Hvg'),
